<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>

    <!-- Google fonts -->
    <link rel="preconnect" href="https://fonts.gstatic.com">
    <link href="https://fonts.googleapis.com/css2?family=Qwigley&family=Raleway:wght@200;800&display=swap" rel="stylesheet">

    <style>
        /*
        Fonty:
        font-family: 'Qwigley', cursive;
        font-family: 'Raleway', sans-serif;
        */
        
        * {
            font-family: 'Raleway', sans-serif;
            font-size: 100%;
            margin: 0;
            padding: 0;
        }
        
        html,
        body {
            height: 100%;
            background-color: rgb(58, 58, 58);
        }
        /*
         * HEADER
         */
        
        header {
            position: relative;
            width: 80%;
            height: 100%;
            margin: auto;
        }
        /* SVG options */
        
        header svg {
            position: absolute;
            transform: translate(-50%, -50%);
            top: 40%;
            width: 30%;
            opacity: 0;
        }
        
        #First {
            left: 40%;
            animation: svg_show 1s ease forwards;
        }
        
        #Second {
            left: 50%;
            animation: svg_show 1s ease forwards .2s;
        }
        
        #Third {
            left: 60%;
            animation: svg_show 1s ease forwards .4s;
        }
        
        @keyframes svg_show {
            to {
                opacity: 1;
                top: 50%;
            }
        }
        /* ŠIMON options */
        
        header h1 {
            position: absolute;
            font-size: 800%;
            display: flex;
            justify-content: center;
            align-items: center;
            width: 100%;
            height: 100%;
            color: #3DDC84;
            background-color: rgba(58, 58, 58, .8);
            z-index: 1;
            opacity: 0;
            animation: h1_show .5s ease forwards .5s;
        }
        
        @keyframes h1_show {
            to {
                opacity: 1;
            }
        }
        /*
         * MEDIA Q.
         */
        
        @media only screen and (max-width: 700px) {
            header {
                width: 100%;
                height: 70%;
                left: 0;
            }
            header svg {
                width: 50%;
            }
            header h1 {
                font-size: 700%;
            }
        }
        
        @media only screen and (max-width: 500px) {
            header {
                height: 50%;
            }
            header h1 {
                font-size: 500%;
            }
        }
    </style>
</head>

